  \"Nesting Loggerhead Sea Turtle Activity Report 2001\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 24,\n\t\t\"recent\": 3\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:42.393652\",\n\t\"name\": \"nesting-loggerhead-sea-turtle-activity-report-2001\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This paper presents results from the 9th
  Annual Study (using Army Corp of Engineers funds) of nesting by the Atlantic loggerhead
  sea turtle (Caretta caretta) along the Atlantic Ocean coastline in Virginia Beach,
  Virginia during 2001. All surveys were implemented by staff of the Back Bay National
  Wildlife Refuge, Virginia Beach, Virginia, throughout the sea turtle nesting season.
  Two seasonal, full-time biological technicians were hired to search twenty-five
  miles of beach along the northern periphery of the nesting range of the Atlantic
  loggerhead. Refuge biologists investigated two loggerhead sea turtle crawls during
  the 2001 nesting season. The first successful nesting for the 2001 nesting season
  occurred on Back Bay NWR, 0.2 miles south of Little Island City Park, on the North
  Mile. This first nest consisted of 127 eggs. A second crawl was detected on False
  Cape State Park, seven miles south of the Back Bay NWR beach access ramp. It yielded
  a nest of 115 eggs. This nest and the female loggerhead were located by Virginia
  Institute of Marine Science (VIMS) personnel on July 2, 2001, during a night patrol.
  They captured the nesting adult female and applied a flipper tag and satellite transmitter.
  No nests or crawls were located along the oceanfront of Sandbridge, the Virginia
  Beach Resort Area, or Fort Story during 2001. Night patrols were conducted from
  June 15 to August 15 by VIMS personnel. Only one loggerhead sea turtle was captured
  this year.  Five attached appendices also include: 1) Year 2001 Sea Turtle Strandings,
  2) Year 2001 Sea Turtle Nest Relocations, 3) A Marine Science Museum Hatchling Report
  for 2000-2001, 4) Article on the Release of VMSM Year-Old Hatchlings 5) A 2001 Summary
  of Costs Associated with this program.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
